import React from "react";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import Button from '@material-ui/core/Button';
import { makeStyles } from "@material-ui/core/styles";
import { elementNames } from '../utilities/constants';

const useStyles = makeStyles((theme) => ({
	preContainer: {
		display:"inline-block", 
		padding:"0 1em",
		margin: "0 0 0.5em",
	},
    downloadButton: {
		margin: "1em 0.5em",
	},
}));

const DisplayJson = (props) => {
	const { jsonresp, submittedParams } = props;
    const classes = useStyles();
    const eNames = elementNames();
    const sElems = [{name:'date'}, ...JSON.parse(submittedParams).elems];

    return (
        <div>
            <Paper variant="outlined" className={classes.preContainer}>
                <Typography variant="subtitle1">
                    Results:
                </Typography>
                {jsonresp[0].map((col,i) => (
                    <Typography variant="body1" key={i}>
                        {eNames[sElems[i].name]}: {sElems[i].name !== 'date' ? (parseFloat(col).toFixed(sElems[i].name === 'pcpn' ? 2 : 1)) : col}
                    </Typography>
                ))}
            </Paper>
            <br />
            <Button variant="contained" className={classes.downloadButton}>Download data (json)</Button>
        </div>
    );
}

export default DisplayJson;
